import React from "react";
import "./filter.css";

const Filter = () => {
  return (
    <div id="filter-container">
      <div className="row">
        <div className="form-group col-sm-12">
          <label for="exampleInputEmail1" />
          <input
            type="email"
            className="form-control"
            id="exampleInputEmail1"
            placeholder="Enter email"
          />
        </div>
      </div>
    </div>
  );
};

export default Filter;
